import React from "react";

export const TableOfProducts = () => {
  return (
    <div>
      <table className="table table-bordered border-primary">
        <thead><tr>
            <td>#</td>
            <td>دسته</td>
            <td>عنوان</td>
            <td>وضعیت</td>
            <td>عملیات</td>
            </tr></thead>
        <tbody><tr></tr></tbody>
      </table>
    </div>
  );
};
